import { Route, Routes } from 'react-router-dom';
import './App.css';
import Main from './Main';
function App() {
  return (
    <div>

        <Routes>
          <Route path='/'  element={<Main/>}  />
          <Route path='/collage'  element={<Main/>}  />
          <Route path='/scorolling'  element={<Main/>}  />
          <Route path='/carsoul'  element={<Main/>}  />
        </Routes>

    </div>
  );
}

export default App;
